libs.content:
find_library(sdl2_net_library
  names sdl2_net
  hints
    ${pc_sdl2_net_libdir}
    ${pc_sdl2_net_library_dirs}
  path_suffixes x64 x86
)

find_library(sdlimage_library 
  names sdl_image
  paths
  $env{sdlimagedir}
  $env{sdldir}
  no_default_path
    path_suffixes lib64 lib
)

find_library(sdlnet_library 
  names sdl_net
  paths
  $env{sdlnetdir}
  $env{sdldir}
  no_default_path
    path_suffixes lib64 lib
)

find_library(sdl2_library_temp
	names sdl2
	hints
	$env{sdl2dir}
	path_suffixes lib64 lib libs64 libs libs/win32 libs/win64
	paths ${sdl2_search_paths}
)

find_library(sdl2main_library
			names sdl2main
			hints
			$env{sdl2dir}
			path_suffixes lib64 lib
			paths ${sdl2_search_paths}
		)

find_library(steamworks_cwrapper_library names steamworks_cwrapper
		paths ${lib_search_paths}
		doc "steamworks c wrapper library name"
	)

find_library(ogg_library
           names ogg ogg ogg
           paths
           $env{oggdir}/lib
           $env{oggdir}
           $env{vorbisdir}/lib
           $env{vorbisdir}
           $env{speexdir}/lib
           $env{speexdir}
           $env{sdlsounddir}/lib
           $env{sdlsounddir}
           $env{sdldir}/lib
           $env{sdldir}
           /usr/local/lib
           /usr/lib
           /sw/lib
           /opt/local/lib
           /opt/csw/lib
         /opt/lib
           )

find_library(sdlttf_library 
  names sdl_ttf
  paths
  $env{sdlttfdir}
  $env{sdldir}
  no_default_path
    path_suffixes lib64 lib
)

find_library(steamworks_library names steam_api
			paths ${lib_search_paths}
			doc "steamworks library name"
		)

find_library(sdlmixer_library 
  names sdl_mixer
  paths
  $env{sdlmixerdir}
  $env{sdldir}
  no_default_path
    path_suffixes lib64 lib
)
